import logo from './logo.svg';
import './App.css';
import React from 'react';
import './App.css'; // Make sure you have an App.css file for styling

function App() {
  // Assuming your images are named 'graph1.jpg', 'graph2.jpg', etc., and stored in the public folder
  const graphImages = [
    'graph1.jpg',
    'graph2.jpg',
    'graph3.jpg',
    'graph4.jpg',
    'graph5.jpg',
    'graph6.jpg',
  ];

  return (
    <div className="grid-container">
      {graphImages.map((imageName, index) => (
        <div key={index} className="grid-item">
          <img src={`${process.env.PUBLIC_URL}/${imageName}`} alt={`Graph ${index + 1}`} />
        </div>
      ))}
    </div>
  );
}

export default App;
